This is a simple test:

```
class A {
    constructor() {
        this.value = "A";
    }

    set someValue(value) {
        this.value = value;
    }

    removeMe() {}
};

class B extends A {
    constructor() {
        super();
        this.someValue = "B";
    }
};

console.log(new B().value);
```
Output should be `B`, but with ADVANCED mode it's `A`. But if you'll remove `removeMe() {}` the output is `B` as expected.

