When using ADVANCED_OPTIMIZATIONS option, the compiler ignores overriden functions that just call base class method without passing optional arguments:
 
```js
/**
 * @param {number=} width
 * @param {number=} height
 */
Foo.prototype.resize = function(width, height) {}
```
 
it is ok when undefined height is passed explicitly
```js
/** @inheritDoc */
Bar.prototype.resize = function(width, height) {
    goog.base(this, "resize", width, undefined);
};
```
 
However, if height is not passed, the compiler throws away Bar.prototype.resize method completely
```js
/** @inheritDoc */
Bar2.prototype.resize = function(width, height) {
    goog.base(this, "resize", width);
};
```
 
this bar will be removed from output code
```js
    bar.resize(100, 200);
    console.log(bar.width(), bar.height()); // 100 undefined
 
    bar2.resize(100, 200);
    console.log(bar2.width(), bar2.height()); // 100 200
```
 
Minimal code to reproduce this issue: [main.txt](https://github.com/google/closure-compiler/files/563906/main.txt)

My team has a bunch of code that uses `/** @enum {number} */` that include an entry for 0.  We also have a lot of nullable references to these enum values.  If we want different behavior depending on whether the variable has a non-null value, then we'll usually check `value == null`.

When `--use_types_for_optimization` is turned on, these checks get optimized into a truthiness check.  This is incorrect when the enum contains 0.  For example:

``` js
/** @enum {number} */
var Vehicle = {
  CAR: 0,
  TRUCK: 1,
  BICYCLE: 2,
  VAN: 3,
  UNKNOWN: 4,
};

/**
 * @param {?Vehicle} v
 * @return {Vehicle}
 */
function vehicleOrDefault(v) {
  if (v == null) {
    return Vehicle.UNKNOWN;
  }
  return v;
}

var testCases = [null, Vehicle.CAR, Vehicle.VAN];
console.log(testCases.map(vehicleOrDefault));
```

is incorrectly optimizing to:

``` js
console.log([null,0,3].map(function(a){return a?a:4}));
```

If I use `--use_types_for_optimization=false`, this same code compiles correctly:

``` js
console.log([null,0,3].map(function(a){return null==a?4:a}));
```

(We're also using ADVANCED_OPTIMIZATIONS, compiling ES6 input to ES5_STRICT output, etc.)

