```

This appears to be due to the transpiler rewriting elems in the transpiled body with an explicit type annotation of `/** @type {!Array<T>} */` ([see debugger](https://closure-compiler-debugger.appspot.com/#input0%3D%252F**%2520%2540template%2520E%250A%2520%2520%2520%2520%2540param%2520%257B...E%257D%2520elems%2520*%252F%250Afunction%2520f%28...elems%29%2520%257B%2520sink%28elems%29%253B%2520%257D%250A%26input1%26conformanceConfig%26externs%3Dfunction%2520sink%28var_args%29%2520%257B%257D%26refasterjs-template%26includeDefaultExterns%3D1%26CHECK_SYMBOLS%3D1%26CHECK_TYPES%3D1%26CLOSURE_PASS%3D1%26LANG_IN_IS_ES6%3D1%26MISSING_PROPERTIES%3D1%26PRESERVE_TYPE_ANNOTATIONS%3D1%26PRETTY_PRINT%3D1%26TRANSPILE%3D1)), and OTI complains about referencing the method's template parameter in the method body.

The same error happens even if the rest type isn't itself generic, but depends on generics, e.g. `{...!Iterable<T>}` also leads to an error.

Since this is actually checked correctly in NTI, it's potentially reasonable to simply have OTI treat template types as unknowns and allow this, since any type errors will still show up correctly in NTI.

