Calling `super` from an arrow function doesn't use the defining method scope, but instead uses the calling scope.

Repro:

``` javascript
// ==ClosureCompiler==
// @compilation_level SIMPLE_OPTIMIZATIONS
// @output_file_name default.js
// @formatting pretty_print
// ==/ClosureCompiler==

class Y {
  constructor() {
    this.message = 'IN Y FOO';
