Observe how Bar function takes no arguments. However, [the draft](https://people.mozilla.org/~jorendorff/es6-draft.html#sec-runtime-semantics-classdefinitionevaluation) states that:

> If _constructor_ is **empty**, then if _ClassHeritage__opt is present, then let _constructor_ be the result of parsing the String `constructor(... args){ super (...args);}` using the syntactic grammar with the goal symbol _MethodDefinition_.

As such, generated Bar function should be:

```
Bar = function(a) {
  a = [].slice.call(arguments, 0);
  Bar.base(this, "constructor", ...a);
};
```

