Our parser considers the second child of a `case` node to be a block, even if there are no `{}` in the source. So, for this code:

```
var foo = 0;
switch (foo) {
  case 0:
    let y = 1;
  default:
    console.log(y);
}
```

Traceur converts it to

```
var foo = 0;
switch (foo) {
  case 0:
    var y = 1;
  default:
    console.log(y);
}
```

which I believe is correct, and prints `1`, whereas we get an error when trying to transpile:

```
ERROR - variable y is undeclared
    console.log(y);
                ^
```

The following snippet,

``` js
// ==ClosureCompiler==
// @compilation_level SIMPLE_OPTIMIZATIONS
// @formatting pretty_print
// ==/ClosureCompiler==

(function() {
    var i = 0;
    while(i < 7) {
        var _ = true;
        do {
            if(i == 2) continue;
            if(i == 4) break;
            console.log(i);
        } while(_ = false);
        if(_) break;
        i++;
    }
})();
```

Is equivalent to

``` js
for (var i = 0; i < 7; i++) {
    if (i == 2) continue;
    if (i == 4) break;
    console.log(i);
}
```

and originally outputs `0`, `1`, `3`.
However, doing simple or advanced optimizations with Closure results in it being optimized to

``` js
(function() {
  for (var a = 0;7 > a;) {
    2 != a && 4 != a && console.log(a), a++;
  }
})();
```

which will output `0`, `1`, `3`, `5`, `6`.

Shown structure is needed due to code generator (Haxe) not supporting C-styled for-loops, meaning that these have to be done with macros.
Excluding this particular flaw, Closure actually converts the structure to something similar to what source code was meant to do, which is pretty nice.

See thread here:
https://groups.google.com/forum/#!topic/closure-compiler-discuss/Al990_NyydY

``` js
(function() {
  /** @typedef {number} */ var Num;
  /** @type {Num} */
  var n;
}());
```

We will fix this in the new type inference, but unlikely before then.

